import React from 'react';
import Ann_reg_back from '../Ann_Register/Assests/Ann_reg_back.png';
import './ann_register.css';
import { Button } from '@mui/material';

export default function Ann_Register() {
  return (
    <div className='Ann_reg_first' style={{ backgroundImage: `url(${Ann_reg_back})`, marginTop: "4%" }}>
      <p className='Ann_reg_footer'>
        "Welcome to Eventease, the premier platform connecting customers with top-rated service providers for all their event planning needs! Whether you're organizing a wedding, birthday party, corporate event, or any other special occasion, our easy-to-use platform lets you browse and book from a curated selection of vendors who are experts in their field.
      </p>
      <div className='ann_reg_button'>
        <Button variant="outlined" href='/customer_Registration'>
          <span>Register as a<br /><b>Customer</b></span>
        </Button>
        <Button variant="outlined" href='/customer_Registration'>
          <span>Register as a<br /><b>Service provider</b></span>
        </Button>
      </div>
    </div>
  );
}
